import{_ as i,c as o,a2 as l,o as r}from"./chunks/framework.Cv6Grnpd.js";const m=JSON.parse('{"title":"UAParser.js Changelog","description":"","frontmatter":{},"headers":[],"relativePath":"intro/changelog.md","filePath":"intro/changelog.md","lastUpdated":1741510753000}'),a={name:"intro/changelog.md"};function n(d,e,t,s,c,u){return r(),o("div",null,e[0]||(e[0]=[l('<h1 id="uaparser-js-changelog" tabindex="-1">UAParser.js Changelog <a class="header-anchor" href="#uaparser-js-changelog" aria-label="Permalink to &quot;UAParser.js Changelog&quot;">​</a></h1><h2 id="version-2-0-2" tabindex="-1">Version 2.0.2 <a class="header-anchor" href="#version-2-0-2" aria-label="Permalink to &quot;Version 2.0.2&quot;">​</a></h2><ul><li>Fix TypeScript dependency issue</li></ul><h2 id="version-2-0-1" tabindex="-1">Version 2.0.1 <a class="header-anchor" href="#version-2-0-1" aria-label="Permalink to &quot;Version 2.0.1&quot;">​</a></h2><ul><li>Add new browser: Ladybird, Daum</li><li>Add new device: Apple HomePod</li><li>Add new device vendor: HMD</li><li>Add new OS: Ubuntu Touch, Windows IoT</li><li>Improve CPU detection: ARM, x86</li><li>Improve device detection: Lenovo, Nokia, Nvidia, Xiaomi <ul><li>Tablet: Google, Honor, Huawei, Infinix, Nokia, OnePlus, Xiaomi</li><li>Wearable: Asus, Google, LG, Motorola, OnePlus, Oppo, Samsung, Sony</li><li>Smart-TV: Xiaomi, unidentified vendors</li><li>Improve detection for unknown VR devices</li><li>Improve device model detection for Generic devices</li></ul></li><li>Improve OS detection: Linux, Symbian</li><li>Improve TypeScript definitions for Headers</li><li>Improve <code>withClientHints()</code>: <ul><li><code>engine.version</code> also get updated</li><li>Infer <code>device.vendor</code> &amp; <code>device.type</code> by guessing from <code>device.model</code></li><li>Browser naming adjustments: <ul><li><code>Google Chrome</code> =&gt; <code>Chrome</code></li><li><code>Microsoft Edge</code> =&gt; <code>Edge</code></li><li><code>Android WebView</code> =&gt; <code>Chrome WebView</code></li><li><code>HeadlessChrome</code> =&gt; <code>Chrome Headless</code></li></ul></li></ul></li><li><code>enums</code> submodule: <ul><li>Add TypeScript definitions</li></ul></li><li><code>extensions</code> submodule: <ul><li>Add new list: <ul><li><code>Vehicles</code>: BYD, Rivian, Volvo</li></ul></li><li>Add new Fetcher: Bluesky</li><li>Add new Library: Apache-HttpClient, go-http-client, got, GuzzleHttp, Java-http-client, libwww-perl, lua-resty-http, Needle, OkHttp, node-fetch, PHP-SOAP, PostmanRuntime, superagent</li></ul></li></ul><h2 id="version-2-0-0" tabindex="-1">Version 2.0.0 <a class="header-anchor" href="#version-2-0-0" aria-label="Permalink to &quot;Version 2.0.0&quot;">​</a></h2><ul><li><code>ua-parser-js/extensions</code> submodule: <ul><li>Add new CLI: ELinks, HTTPie</li><li>Add new crawler: AI2Bot, aiHitBot, anthropic-ai, Diffbot, ImagesiftBot, magpie-crawler, Omgilibot, Screaming Frog SEO Spider, Seznambot, Teoma, Timpibot, VelenPublicWebCrawler, Webzio-Extended, YouBot</li><li>Add new email: Airmail, BlueMail, eMClient, NaverMailApp, Sparrow, Yahoo</li><li>Add new fetcher: cohere-ai, Vercelbot</li><li>Add new library: java, python-urllib, python-requests</li></ul></li><li><code>ua-parser-js/helpers</code> submodule: <ul><li>Add new method <code>isAIBot()</code>: Checks if the user-agent is an AI bot</li></ul></li></ul><h2 id="version-2-0-0-rc-3" tabindex="-1">Version 2.0.0-rc.3 <a class="header-anchor" href="#version-2-0-0-rc-3" aria-label="Permalink to &quot;Version 2.0.0-rc.3&quot;">​</a></h2><ul><li>Add support for Headers object</li><li>Add new device: Advan, Cat, Energizer, Honor, IMO, Micromax, Smartfren</li><li>Add new engine: Servo</li><li><code>ua-parser-js/extensions</code> submodule: <ul><li>Breaking change: rename <code>module</code> to <code>library</code></li><li>Add new email clients: Evolution, KMail, Kontact</li><li>Add new bots: 360Spider, Archive.org Bots, CCBot, DataForSeoBot, DuckAssistBot, Exabot, Google Bots, Meta Bots, MojeekBot, PerplexityBot, PetalBot, TurnitinBot, Yeti, YisouSpider</li></ul></li></ul><h2 id="version-2-0-0-rc-2" tabindex="-1">Version 2.0.0-rc.2 <a class="header-anchor" href="#version-2-0-0-rc-2" aria-label="Permalink to &quot;Version 2.0.0-rc.2&quot;">​</a></h2><ul><li>Fix incorrect import path in ESM files</li><li>Add new browser: 115, SlimBoat, Slimjet, LibreWolf</li><li>Improve browser detection: 2345, 360, Dragon, Iron, Maxthon</li><li><code>ua-parser-js/enums</code> submodule: <ul><li>Add Chromecast OS variants: Android/Fuchsia/Linux/SmartSpeaker</li></ul></li><li><code>ua-parser-js/helpers</code> submodule: <ul><li>Add new method: <code>isBot()</code> to check if the browser is identified as a bot</li></ul></li></ul><h2 id="version-2-0-0-rc-1" tabindex="-1">Version 2.0.0-rc.1 <a class="header-anchor" href="#version-2-0-0-rc-1" aria-label="Permalink to &quot;Version 2.0.0-rc.1&quot;">​</a></h2><ul><li>Fix Python Request mistakenly identified as Meta Quest</li><li>Add new browser: Helio</li><li>Add new device: itel, Nothing, Pico, TCL</li><li>Add new engine: ArkWeb</li><li>Add new OS: OpenHarmony, Pico</li><li>Improve browser detection: Quark</li><li>Improve device detection: Xiaomi, Amazon Echo Show, Google Chromecast, Samsung Galaxy Watch</li><li><code>ua-parser-js/helpers</code> submodule: <ul><li>Add new method: <ul><li><code>getDeviceVendor()</code> to guess for a device vendor based on its model name</li><li><code>isElectron()</code> to check if current window is running inside Electron</li><li><code>isFromEU()</code> to check if current window is from an EU (European Union) country</li><li><code>isStandalonePWA()</code> to check if current window is a standalone PWA</li></ul></li><li>Rename <code>isChromiumBased()</code> to <code>isChromeFamily()</code></li><li>Update <code>isAppleSilicon()</code> to also checks for WebGL renderer info</li></ul></li><li><code>ua-parser-js/extensions</code> submodule: <ul><li>Restore <code>Bots</code> as a compilation of all these browser types: <code>cli</code>, <code>crawler</code>, <code>fetcher</code>, and <code>library</code></li></ul></li></ul><h2 id="version-2-0-0-beta-3" tabindex="-1">Version 2.0.0-beta.3 <a class="header-anchor" href="#version-2-0-0-beta-3" aria-label="Permalink to &quot;Version 2.0.0-beta.3&quot;">​</a></h2><ul><li>Breaking: <ul><li>AR/VR devices moved to new device type: <code>xr</code></li><li>New property in <code>browser</code>: <code>type</code></li></ul></li><li>New features: <ul><li>Parse directly from command line using <code>npx ua-parser-js</code></li><li>Extensions can be passed as a list to <code>UAParser()</code></li></ul></li><li>Add new browser: Pico Browser, Twitter, Wolvic</li><li>Improve browser detection: DuckDuckGo, ICEBrowser, Klar, QQ, Sleipnir</li><li>Improve device detection: Oculus Quest &amp; Oppo Pad</li><li>Update latest client hints spec: <code>formFactor</code> -&gt; <code>formFactors</code></li><li>In <code>ua-parser-js/extensions</code> submodule, <code>bots</code> divided into <code>crawler</code> / <code>fetcher</code></li></ul><h2 id="version-2-0-0-beta-2" tabindex="-1">Version 2.0.0-beta.2 <a class="header-anchor" href="#version-2-0-0-beta-2" aria-label="Permalink to &quot;Version 2.0.0-beta.2&quot;">​</a></h2><ul><li>Increase UA_MAX_LENGTH to 500</li><li>Add TypeScript declaration file in <code>ua-parser-js/extensions</code> submodule</li><li>Improve TypeScript module resolution</li><li>Add new methods in <code>ua-parser-js/helpers</code> submodule: <code>isAppleSilicon()</code> &amp; <code>isChromiumBased()</code></li><li>Fix misidentified WebView token as device model</li><li>Add new browser: Alipay, Klarna, Opera GX, Smart Lenovo Browser, Vivo Browser</li><li>Rename browser: Avant, Baidu, Samsung Internet, Sogou Explorer, Sogou Mobile, WeChat</li><li>Improve client-hints detection: Edge, Xbox</li></ul><h2 id="version-2-0-0-beta-1" tabindex="-1">Version 2.0.0-beta.1 <a class="header-anchor" href="#version-2-0-0-beta-1" aria-label="Permalink to &quot;Version 2.0.0-beta.1&quot;">​</a></h2><ul><li>Update Client Hints Form-Factor</li><li>Provide in-package type definitions</li><li>Add new device: Ulefone</li><li>Improve device detection: Realme, Xiaomi Redmi</li></ul><h2 id="version-2-0-0-alpha-3" tabindex="-1">Version 2.0.0-alpha.3 <a class="header-anchor" href="#version-2-0-0-alpha-3" aria-label="Permalink to &quot;Version 2.0.0-alpha.3&quot;">​</a></h2><ul><li>Add <code>withFeatureCheck()</code> method</li><li>Add <code>isFrozenUA()</code> method in <code>ua-parser-js/helpers</code> submodule</li><li>Add <code>MediaPlayers</code> &amp; <code>Modules</code> in <code>ua-parser-js/extensions</code> submodule</li><li>Fix issue with ESM import</li></ul><h2 id="version-2-0-0-alpha-2" tabindex="-1">Version 2.0.0-alpha.2 <a class="header-anchor" href="#version-2-0-0-alpha-2" aria-label="Permalink to &quot;Version 2.0.0-alpha.2&quot;">​</a></h2><ul><li>Fix browser result always returning Chromium when using withClientHints()</li><li>Fix infinite-loop when await-ing withClientHints() in non-client-hints browser</li></ul><h2 id="version-2-0-0-alpha-1" tabindex="-1">Version 2.0.0-alpha.1 <a class="header-anchor" href="#version-2-0-0-alpha-1" aria-label="Permalink to &quot;Version 2.0.0-alpha.1&quot;">​</a></h2><ul><li>Initial work on new major version</li></ul><hr><h2 id="version-0-7-40-1-0-40" tabindex="-1">Version 0.7.40 / 1.0.40 <a class="header-anchor" href="#version-0-7-40-1-0-40" aria-label="Permalink to &quot;Version 0.7.40 / 1.0.40&quot;">​</a></h2><ul><li>Add new browser: 115, LibreWolf, Slimboat, Slimjet</li><li>Add new device: Advan, Cat, Energizer, IMO, Micromax, Smartfren</li><li>Add new engine: ArkWeb, Servo</li><li>Add new os: OpenHarmony</li><li>Improve browser detection: 2345, 360, Dragon, Iron, Maxthon</li><li>Recognize Honor as a separate device vendor from Huawei</li><li>Fix Python Request mistakenly identified as Meta Quest</li></ul><h2 id="version-0-7-39-1-0-39" tabindex="-1">Version 0.7.39 / 1.0.39 <a class="header-anchor" href="#version-0-7-39-1-0-39" aria-label="Permalink to &quot;Version 0.7.39 / 1.0.39&quot;">​</a></h2><ul><li>Add new feature: executable command using <code>npx ua-parser-js &quot;[INSERT-UA-HERE]&quot;</code></li><li>Add new browser: Helio, Pico Browser, Wolvic</li><li>Add new device vendor: itel, Nothing, TCL</li><li>Improve browser detection: ICEBrowser, Klar, QQBrowser, Quark, Rekonq, Sleipnir</li><li>Improve device detection: Xiaomi Pro, Amazon Echo Show, Samsung Galaxy Watch</li><li>Removed from browser: Viera</li></ul><h2 id="version-0-7-38-1-0-38" tabindex="-1">Version 0.7.38 / 1.0.38 <a class="header-anchor" href="#version-0-7-38-1-0-38" aria-label="Permalink to &quot;Version 0.7.38 / 1.0.38&quot;">​</a></h2><ul><li>Fix error on getOS() when userAgentData.platform is undefined</li><li>Add new browser: Opera GX, Twitter</li><li>Improve browser detection: DuckDuckGo</li><li>Improve device detection: OPPO Pad, Oculus Quest</li></ul><h2 id="version-0-7-37-1-0-37" tabindex="-1">Version 0.7.37 / 1.0.37 <a class="header-anchor" href="#version-0-7-37-1-0-37" aria-label="Permalink to &quot;Version 0.7.37 / 1.0.37&quot;">​</a></h2><ul><li>Fix misidentified WebView token as device model</li><li>Increase UA_MAX_LENGTH to 500</li><li>Add new browser: Alipay, Klarna, Smart Lenovo Browser, Vivo Browser</li><li>Add new device: Ulefone</li><li>Improve device detection: Realme, Xiaomi Redmi</li><li>Rename browser: Avant, Baidu, Samsung Internet, Sogou Explorer, Sogou Mobile, WeChat</li></ul><h2 id="version-0-7-36-1-0-36" tabindex="-1">Version 0.7.36 / 1.0.36 <a class="header-anchor" href="#version-0-7-36-1-0-36" aria-label="Permalink to &quot;Version 0.7.36 / 1.0.36&quot;">​</a></h2><ul><li>Add new browser: Snapchat</li><li>Add new devices: Infinix, Tecno</li><li>Improve device detection: Amazon Fire TV, Xiaomi POCO</li><li>Improve OS detection: iOS</li></ul><h2 id="version-0-7-35-1-0-35" tabindex="-1">Version 0.7.35 / 1.0.35 <a class="header-anchor" href="#version-0-7-35-1-0-35" aria-label="Permalink to &quot;Version 0.7.35 / 1.0.35&quot;">​</a></h2><ul><li>Fix result from user-supplied user-agent being altered</li><li>Add new browser: Heytap, TikTok</li><li>Add new engine: LibWeb</li><li>Add new OS: SerenityOS</li><li>Improve browser detection: Yandex</li><li>Improve device detection: iPhone, Amazon Echo</li><li>Improve OS detection: iOS</li></ul><h2 id="version-0-7-34-1-0-34" tabindex="-1">Version 0.7.34 / 1.0.34 <a class="header-anchor" href="#version-0-7-34-1-0-34" aria-label="Permalink to &quot;Version 0.7.34 / 1.0.34&quot;">​</a></h2><ul><li>Fix Sharp Mobile detected as Huawei Tablet</li><li>Fix IE8 bug</li><li>Add new devices : Kobo e-Reader, Apple Watch, and some new SmartTV devices</li><li>Add new OS : watchOS</li><li>Improve browser detection : Kakao, Naver, Brave</li><li>Improve device detection : Oculus, iPad</li><li>Improve OS detection : Chrome OS</li><li>Using navigator.userAgentData as fallback for device.type &amp; os.name</li></ul><h2 id="version-0-7-33-1-0-33" tabindex="-1">Version 0.7.33 / 1.0.33 <a class="header-anchor" href="#version-0-7-33-1-0-33" aria-label="Permalink to &quot;Version 0.7.33 / 1.0.33&quot;">​</a></h2><ul><li>Add new browser : Cobalt</li><li>Identify Macintosh as an Apple device</li><li>Fix ReDoS vulnerability</li></ul><h2 id="version-0-7-32-1-0-32" tabindex="-1">Version 0.7.32 / 1.0.32 <a class="header-anchor" href="#version-0-7-32-1-0-32" aria-label="Permalink to &quot;Version 0.7.32 / 1.0.32&quot;">​</a></h2><ul><li>Add new browser : DuckDuckGo, Huawei Browser, LinkedIn</li><li>Add new OS : HarmonyOS</li><li>Add some Huawei models</li><li>Add Sharp Aquos TV</li><li>Improve detection Xiaomi Mi CC9</li><li>Fix Sony Xperia 1 III misidentified as Acer tablet</li><li>Fix Detect Sony BRAVIA as SmartTV</li><li>Fix Detect Xiaomi Mi TV as SmartTV</li><li>Fix Detect Galaxy Tab S8 as tablet</li><li>Fix WeGame mistakenly identified as WeChat</li><li>Fix included commas in Safari / Mobile Safari version</li><li>Increase UA_MAX_LENGTH to 350</li></ul><h2 id="version-0-7-31-1-0-2" tabindex="-1">Version 0.7.31 / 1.0.2 <a class="header-anchor" href="#version-0-7-31-1-0-2" aria-label="Permalink to &quot;Version 0.7.31 / 1.0.2&quot;">​</a></h2><ul><li>Fix OPPO Reno A5 incorrect detection</li><li>Fix TypeError Bug</li><li>Use AST to extract regexes and verify them with safe-regex</li></ul><h2 id="version-0-7-30-1-0-1" tabindex="-1">Version 0.7.30 / 1.0.1 <a class="header-anchor" href="#version-0-7-30-1-0-1" aria-label="Permalink to &quot;Version 0.7.30 / 1.0.1&quot;">​</a></h2><ul><li>Add new browser : Obigo, UP.Browser, Klar</li><li>Add new device : Oculus, Roku</li><li>Add new OS: Maemo, HP-UX, Android-x86, Deepin, elementary OS, GhostBSD, Linspire, Manjaro, Sabayon</li><li>Improve detection for Sony Xperia 1ii, LG Android TV, and some more devices</li><li>Improve detection for ARM64 CPU</li><li>Improve detection for Windows Mobile, Netscape, Mac on PowerPC</li><li>Categorize PDA as mobile</li><li>Fix Sharp devices misjudged as Huawei</li><li>Fix trailing comma for ES3 compatibility</li><li>Some code refactor</li></ul><h2 id="version-0-7-1-0" tabindex="-1">Version 0.7 / 1.0 <a class="header-anchor" href="#version-0-7-1-0" aria-label="Permalink to &quot;Version 0.7 / 1.0&quot;">​</a></h2><p>Version 1.0.x is basically the equivalent of version 0.7.x (mirror/duplicate). See <a href="https://github.com/faisalman/ua-parser-js/issues/536" target="_blank" rel="noreferrer">#536</a> for the reason behind this confusion.</p><h2 id="version-0-8" tabindex="-1">Version 0.8 <a class="header-anchor" href="#version-0-8" aria-label="Permalink to &quot;Version 0.8&quot;">​</a></h2><p>Version 0.8 was created by accident. This version is now deprecated and no longer maintained, please update to version 0.7 / 1.0.</p>',52)]))}const p=i(a,[["render",n]]);export{m as __pageData,p as default};
